import React from 'react';

function myFun(){
    var e = document.getElementsByClassName("eve")[0]
    e.style.color = 'red';
}
function Fun(){
    var e = document.getElementsByClassName("eve")[0]
    e.style.color = 'green';
}
function my(){
    var e = document.getElementsByClassName("eve")[0]
    e.style.color = 'yellow';
}

function Event(){
    return(
        <>
        <p className="eve">this iss a pera </p>
        <button className="btn btn-xl" onClick={myFun}>click</button>
        <button className="btn btn-xl" onMouseOver={Fun}>click</button>        
        <button className="btn btn-xl" onMouseOut={my}>click</button>
        </>

    )
}

export default Event
